import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const Fooditems = ({
  macro: { nutrientName, unitName, value, nutrientId },
}) => {
  return (
    <Container>
      <Row>
        {nutrientId === 1003 ? (
          <Col>1 of 3</Col>
        ) : nutrientId === 1004 ? (
          <Col>2 of 3</Col>
        ) : nutrientId === 1005 ? (
          <Col>3 of 3</Col>
        ) : null}
      </Row>
    </Container>
  );
};

export default Fooditems;
